// Intercetta la chiamata GET e fornisce una risposta mockata
cy.intercept('GET', 'https://reqres.in/api/users?page=2', {
  statusCode: 200,
  body: {
    page: 2,
    per_page: 6,
    total: 12,
    total_pages: 2,
    data: [{
      id: 999,
      email: 'mocked@user.com',
      first_name: 'Mocked',
      last_name: 'User'
    }]
  }
}).as('mockUsers');
// Visita la pagina (le richieste dal browser saranno intercettate)
cy.visit('https://reqres.in/');
// Aspetta che la chiamata intercettata avvenga e verifica lo status
cy.wait('@mockUsers').then(interception => {
  expect(interception.response.statusCode).to.eq(200);
  // Controlla il contenuto mockato
  expect(interception.response.body.data[0]).to.deep.equal({
    id: 999,
    email: 'mocked@user.com',
    first_name: 'Mocked',
    last_name: 'User'
  });
});
